-- ----------------------------
--  Table structure for `sys_admin_user`
-- ----------------------------
DROP TABLE IF EXISTS `sys_admin_user`;
CREATE TABLE `sys_admin_user` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '管理员uuid',
  `user_name` varchar(150) COLLATE utf8mb4_bin NOT NULL COMMENT '管理员名称',
  `login_name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '登录名',
  `login_password` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '登录密码',
  `user_phone` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系电话',
  `user_mobile` varchar(12) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系手机',
  `user_status` char(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '0' COMMENT '用户状态（0:正常 2:停用 3:冻结）',
  `user_sort` int(11) DEFAULT NULL COMMENT '显示顺序（升序）',
  `remarks` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注信息',
  `mgr_type` char(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '1' COMMENT '管理员类型（0：超级管理员 1：系统管理员）',
  `create_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='系统管理员信息表';

