-- ----------------------------
--  Table structure for `sys_area`
-- ----------------------------
DROP TABLE IF EXISTS `sys_area`;
CREATE TABLE `sys_area` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '行政区划uuid',
  `parent_uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '上级行政区划uuid',
  `area_code` varchar(10) COLLATE utf8mb4_bin NOT NULL COMMENT '行政区划编码',
  `area_name` varchar(150) COLLATE utf8mb4_bin NOT NULL COMMENT '行政区划名称',
  `area_short_name` varchar(150) COLLATE utf8mb4_bin NOT NULL COMMENT '行政区划简称',
  `area_type` char(1) COLLATE utf8mb4_bin NOT NULL COMMENT '行政区划类型',
  `area_sort` int(11) DEFAULT NULL COMMENT '显示顺序',
  `area_status` char(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '0' COMMENT '使用状态（0:正常  2:停用）',
  `leaf_flag` char(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '1' COMMENT '是否叶子节点（0:否 1:是）',
  `remarks` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注信息',
  `create_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='行政区划表';

