-- ----------------------------
--  Table structure for `sys_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '日志uuid',
  `user_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户uuid',
  `user_name` varchar(150) COLLATE utf8mb4_bin NOT NULL COMMENT '用户名称',
  `log_type` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '日志类型',
  `log_title` varchar(500) COLLATE utf8mb4_bin NOT NULL COMMENT '日志标题',
  `request_uri` varchar(150) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '请求URI',
  `request_method` varchar(30) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '操作方式',
  `request_params` longtext COLLATE utf8mb4_bin COMMENT '操作提交的数据',
  `remote_addr` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '操作IP地址',
  `exception_flag` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '是否异常',
  `exception_info` text COLLATE utf8mb4_bin COMMENT '异常信息',
  `device_name` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '设备名称/操作系统',
  `browser_name` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '浏览器名称',
  `execute_time` decimal(19,0) DEFAULT NULL COMMENT '执行时间(毫秒)',
  `create_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='操作日志表';

-- ----------------------------
--  Table structure for `sys_menu`
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '菜单uuid',
  `parent_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '上级菜单uuid',
  `menu_name` varchar(150) COLLATE utf8mb4_bin NOT NULL COMMENT '菜单名称',
  `menu_type` char(1) COLLATE utf8mb4_bin DEFAULT '1' COMMENT '菜单类型（0:目录 1:菜单 2:权限）',
  `menu_href` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '菜单地址',
  `menu_icon` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '菜单图标',
  `menu_color` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '菜单颜色',
  `menu_target` char(1) COLLATE utf8mb4_bin NOT NULL COMMENT '菜单打开方式',
  `menu_sort` int(11) DEFAULT NULL COMMENT '显示顺序',
  `menu_weight` int(11) DEFAULT NULL COMMENT '菜单权重',
  `sys_code` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '归属系统（jeeadmin:系统管理、jeerigger:APP菜单）',
  `permission` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '权限标识',
  `show_flag` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '是否显示（1:显示 0:隐藏）',
  `leaf_flag` char(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '1' COMMENT '是否叶子节点（0:否 1:是）',
  `remarks` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注信息',
  `create_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='系统菜单表';

-- ----------------------------
--  Records of `sys_menu`
