-- ----------------------------
--  Table structure for `sys_org`
-- ----------------------------
DROP TABLE IF EXISTS `sys_org`;
CREATE TABLE `sys_org` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '组织机构uuid',
  `parent_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '上级组织机构uuid',
  `org_code` varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT '组织机构代码',
  `org_name` varchar(150) COLLATE utf8mb4_bin NOT NULL COMMENT '组织机构名称',
  `org_short_name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '组织机构简称',
  `org_type` varchar(5) COLLATE utf8mb4_bin NOT NULL COMMENT '组织机构类型',
  `org_leader` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '组织机构负责人',
  `org_address` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '组织机构所在地址',
  `org_phone` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '组织机构联系电话',
  `org_postal_code` varchar(6) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '组织机构邮编编码',
  `org_sort` int(11) DEFAULT NULL COMMENT '显示顺序',
  `org_status` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '使用状态（0:正常 2:停用）',
  `leaf_flag` char(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '1' COMMENT '是否叶子节点（0:否 1:是）',
  `remarks` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注信息',
  `create_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='组织机构表';

-- ----------------------------
--  Table structure for `sys_orgadmin_org`
-- ----------------------------
DROP TABLE IF EXISTS `sys_orgadmin_org`;
CREATE TABLE `sys_orgadmin_org` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '主键uuid',
  `user_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户uuid',
  `org_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '组织机构uuid',
  `create_user` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`),
  KEY `fk_orgadmin_org_ref_org` (`org_uuid`),
  KEY `fk_orgadmin_org_ref_user` (`user_uuid`),
  CONSTRAINT `fk_orgadmin_org_ref_org` FOREIGN KEY (`org_uuid`) REFERENCES `sys_org` (`uuid`),
  CONSTRAINT `fk_orgadmin_org_ref_user` FOREIGN KEY (`user_uuid`) REFERENCES `sys_user` (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='组织机构管理员  组织机构分配表';

-- ----------------------------
--  Table structure for `sys_orgadmin_role`
-- ----------------------------
DROP TABLE IF EXISTS `sys_orgadmin_role`;
CREATE TABLE `sys_orgadmin_role` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '主键uuid',
  `user_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户uuid',
  `role_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '角色uuid',
  `create_user` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`),
  KEY `fk_orgadmin_role_ref_role` (`role_uuid`),
  KEY `fk_orgadmin_role_ref_user` (`user_uuid`),
  CONSTRAINT `fk_orgadmin_role_ref_role` FOREIGN KEY (`role_uuid`) REFERENCES `sys_role` (`uuid`),
  CONSTRAINT `fk_orgadmin_role_ref_user` FOREIGN KEY (`user_uuid`) REFERENCES `sys_user` (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='组织机构管理员  角色分配表';

