-- ----------------------------
--  Table structure for `sys_user`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `uuid` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '用户uuid',
  `user_name` varchar(150) COLLATE utf8mb4_bin NOT NULL COMMENT '用户名',
  `login_name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '登录名',
  `login_password` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '登录密码',
  `user_number` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户编号',
  `user_sex` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户性别',
  `identity_type` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '身份证件类型',
  `identity_code` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '身份证件号码',
  `user_duty` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '人员职务',
  `user_rank` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '人员职级',
  `user_phone` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系电话',
  `user_mobile` varchar(12) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系手机',
  `user_address` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系地址',
  `user_email` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '邮箱地址',
  `politics_status` varchar(2) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '政治面貌',
  `org_uuid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '归属机构',
  `user_sort` int(11) DEFAULT NULL COMMENT '用户排序',
  `user_status` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户状态（0:正常 2:停用 3:冻结）',
  `pwd_security_level` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '密码安全级别（0:初始 1:很弱 2:弱 3:安全 4:很安全）',
  `pwd_update_date` datetime DEFAULT NULL COMMENT '密码最后更新时间',
  `remarks` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注信息',
  `mgr_flag` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '是否为机构管理员（0:否 1:是）',
  `freeze_date` datetime DEFAULT NULL COMMENT '冻结时间',
  `freeze_cause` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '冻结原因',
  `last_login_ip` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '最后登陆地址（IP）',
  `last_login_date` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `create_user` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
